import ImageSlider from '../ImageSlider';
import './home.css';


export default function Home() {
    return (
        <div className='slider'>
            <ImageSlider />
            <div className='wrapper'>
                <h1>Welcome to B-Rate</h1>
                <section>
                UCLA holds the title of having the Number 1 dining hall in America. But with such a large variety of options to choose from, students at the university are presented daily with the dilemma of where they should dine. Our app B-Rate seeks to solve this problem. We propose the development of a food review website inspired by Yelp. This web application will be based on the UCLA dining menu and aims to provide Bruins with a simplified dining experience. They will be able to use it to see reviews of food trucks and dining halls left by other people.
                </section>
            </div>
        </div>
    )

}
